import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

function TeamForm({ baseURI, subscribers, setSubscribers, error, setError }) {
  const defaultState = { members: '' };

  const [inputState, setInputState] = useState(defaultState);
  const [inputErrors, setInputErrors] = useState({});

  const handleInputChange = (input, value) => {
    const newInputState = { ...inputState, [input]: value };
    setInputState(newInputState);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await fetch(baseURI, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(inputState),
      });
      if (!response.ok) {
        throw new Error(`Error! status: ${response.status}`);
      }

      const data = await response.json();
      const newSubscribers = [...subscribers, data];
      setSubscribers(newSubscribers);
    } catch (e) {
      error = e.message;
      setError(error);
    }
  };

  return (
    <Form onSubmit={handleSubmit}>
      <Form.Group className='mb-3' controlId='name'>
        <Form.Label>name</Form.Label>
        <Form.Control
          type='text'
          value={inputState.name}
          placeholder='Enter your name'
          onChange={(e) => {
            handleInputChange(e.target.id, e.target.value);
          }}
          isInvalid={inputErrors.name ? true : false}
        />
        <Form.Control.Feedback type='invalid'>
          {inputErrors.name}
        </Form.Control.Feedback>
      </Form.Group>

      <Form.Group className='mb-3' controlId='surname'>
        <Form.Label>Surname</Form.Label>
        <Form.Control
          type='text'
          value={inputState.surname}
          placeholder='Enter your surname'
          onChange={(e) => {
            handleInputChange(e.target.id, e.target.value);
          }}
          isInvalid={inputErrors.name ? true : false}
        />
        <Form.Control.Feedback type='invalid'>
          {inputErrors.name}
        </Form.Control.Feedback>
      </Form.Group>

      <Form.Group className='mb-3' controlId='dateOfBirth'>
        <Form.Label>Date of birth</Form.Label>
        <Form.Control
          type='date'
          value={inputState.dateOfBirth}
          label='Enter your date of birth'
          onChange={(e) => {
            handleInputChange(e.target.id, e.target.value);
          }}
          isInvalid={inputErrors.name ? true : false}
        />
        <Form.Control.Feedback type='invalid'>
          {inputErrors.name}
        </Form.Control.Feedback>
      </Form.Group>

      <Form.Group className='mb-3' controlId='cityOfBirth'>
        <Form.Label>City of birth</Form.Label>
        <Form.Control
          type='text'
          value={inputState.cityOfBirth}
          label='Enter your city of birth'
          onChange={(e) => {
            handleInputChange(e.target.id, e.target.value);
          }}
          isInvalid={inputErrors.name ? true : false}
        />
        <Form.Control.Feedback type='invalid'>
          {inputErrors.name}
        </Form.Control.Feedback>
      </Form.Group>

      <Form.Group className='mb-3' controlId='credit'>
        <Form.Label>Credit</Form.Label>
        <Form.Control
          type='number'
          value={inputState.credit}
          label='Enter your credit'
          onChange={(e) => {
            handleInputChange(e.target.id, e.target.value);
          }}
        />
      </Form.Group>
      <div className='text-center'>
        <Button variant='primary' type='submit'>
          Submit
        </Button>
      </div>
    </Form>
  );
}

export default TeamForm;
